        <div className='timeline-heading'>
            <h2>Holidays</h2>
        </div>
        <div className='vertical-timeline'>
            <ul>
                {
                    date.map((data) => (
                        <li key={data.id} >
                            <h5 className='date'>{data.d}</h5>
                            <p className='occassion'>{data.o}</p>
                            <span className="circle"></span>
                        </li>
                    ))
                }
                <li>

                </li>
            </ul>
        </div>
        
        </>);
};

export default Timeline;
